export const sortDatesLowToHigh = (a, b) => {
    a = new Date(a.bill_date)
    b = new Date(b.bill_date)
    return a < b ? -1 : a > b ? 1 : 0
   }

export const sortDatesHighToLow = (a, b) => {
    a = new Date(a.bill_date)
    b = new Date(b.bill_date)
    return a > b ? -1 : a < b ? 1 : 0
   }
